import React, { useState } from "react";
import { Container } from "reactstrap";
import "./helper-component.css";
import axios from "axios";
import { TabPane, Row, Col } from "reactstrap";
import { Table } from "reactstrap";
import { Form, FormGroup, Label, Input } from "reactstrap";
import { Link } from "react-router-dom";
function HelperComponent() {
  axios.get("http://127.0.0.1:8000/api/jobs/").then((response) => {
    console.log(response.data);
  });

  return (
    <div className="main-div-helper">
      <Container>
        <h1>Helper component </h1>
        <TabPane tabId="2">
          <Row>
            <Col sm="3"></Col>
            <Col sm="6">
              <h4>Reachers you can help now!</h4>
              <Table>
                <thead>
                  <tr>
                    <th>Location of Reachers</th>
                    <th>Job Description</th>
                    <th></th>
                  </tr>
                </thead>
                <tbody>
                  <tr>
                    <td>Location 1</td>
                    <td>Buy Groceries @ 5$</td>
                    <td>
                      <Form>
                        <FormGroup check>
                          <Input type="checkbox" />{" "}
                        </FormGroup>
                      </Form>
                    </td>
                  </tr>

                  <tr>
                    <td>Loaction 2</td>
                    <td>Move furniture @ 10$</td>
                    <td>
                      <Form>
                        <FormGroup check>
                          <Input type="checkbox" />{" "}
                        </FormGroup>
                      </Form>
                    </td>
                  </tr>
                </tbody>
              </Table>
            </Col>
            <Col sm="3"></Col>
          </Row>
        </TabPane>
      </Container>
    </div>
  );
}

export default HelperComponent;
